measurements.description:
Eight well-arranged and spaced flowers on two 37-cm inflorescences;
	sepals ovate, green striped mahogany, suffuse mahogany basally;
	petals nodding, twisted, green, spotted and striped mahogany,
	hirsute edges spotted brown; pouch chartreuse, overlaid cordovan; 
	staminode chartreuse, suffused mahogany; substance firm; texture matte.
